import React from "react";

type P = {
    content: string[]
}

class Answer extends React.Component<P> {
    constructor(props: P){
        super(props)
    }
    render(){
        return(<div>this.props.content.map(answer=>(<div></div>))</div>)
    }
}

export default Answer;
